    borderRadius : "8px",
    padding:"25px",
    // minHeight : "50px",
    marginBottom : "20px",
    color:"white"
};


class Success extends React.Component {



    render() {
        return (
            <div style={formStyle}  >
                <div >

                    <div style={labelStyle} >{"Successfully Registered!"}</div>


                    <nav >
                        <div style={{display :"flex", justifyContent:"center"}}>
                            <span >{"To login "}</span> 
                            <span style='color:red;margin-right:1.25em; display:inline-block;'>&nbsp;</span>
                            <Link to={"login"} style={{ display: 'flex', alignItems: "center", justifyContent: "center" , textDecoration:"none" }}>
                                <span>{" Click Here"}</span>
                            </Link>

                        </div>

                    </nav>
                </div>
            </div>
        )
    }
}

export default Success
